  ('317c3151-f56f-443c-8547-8468b358a785', '176572724341033880', '42d08e9d-1498-41c0-8538-b12f4e3663c7', '73d98b31-d229-422d-8372-1af59b9bd243', 'Winter & Spring Lighthouse Mens Universal Registration for:

APSL, Liga 1 & 2. After those teams are formed we will form Over 30, CASA Saturday or Liga 3 teams.

Due to our generous sponsors & the Lighthouse the registration fee is:
$99 if registered by December 31st.
$125 if registered by January 31st.
$150 if registered from February 1st and after.
We are encouraging early registrations with discounts as that helps the club plan better for the season.

